	(35, 'Automation', 'test', 0, 7, '2. Should Have', 0, '86,87,88,89', 'automation', '', '', 1, '2017-04-06 11:10:36', '2017-04-18 10:27:51', 1, '2017-04-18 10:26:13'),
	(36, 'Ticket 84 , 85', '<div><br></div><div>The good news is that when people are asked, in surveys, how much exercise they do, most claim to do at least these sorts of levels. What is less reassuring is that when researchers look at what people actually do (by asking them to wear accelerometers which measure movement), they find that we tend to massively overestimate our levels of activity.Now, one of the main reasons that people give for not doing more exercise is "lack of time". It certainly used to be my excuse. That is why I am a fan of high intensity interval training (HIIT). I first came across this form of exercise when I was making a film, The Truth About Exercise, for the BBC science series Horizon. In the course of making the film I met Jamie Timmons, professor of precision medicine at King\'s College, London, who assured me that I could get many of the major benefits of exercise from doing a few minutes of HIIT a week</div>', 186395, 7, '1. Must Have', 0, '84,85', '', '1925252616_nav2.png', '1. High', 3, '2017-04-06 11:10:36', '2017-05-16 11:18:55', 0, '0000-00-00 00:00:00'),
