	(196, 'Auto Preschedule', 'Upon submission of the report\r\nby the Admin QA team, the system should automatically schedule the next one in as a tentative pre-scheduled\r\njob. A tick box option which by default is ticked but can be\r\nun-ticked would be available.&nbsp;When entering the new date the\r\nsystem will not check for availability, location or skill matrix it will use\r\nthe Consultant who carried it out last time and the date based on the previous\r\ndate of the assessment + the frequency.\r\n\r\nIdeally this would need to find\r\na \\\'Working day\\\' at roughly the frequency entered, if it lands on a weekend it\r\nshould look for the nearest week day prior to it not after it.&nbsp;The system will p<span>resent back the next date to\r\nthe users as a confirmation message in the pop up<b>.</b></span>', 225322, 9, '2. Should Have', 0, '', 'epic_auto_preschedule', '', '3. Low', 3, '2017-09-05 09:59:41', '2017-10-13 09:51:57', 0, '0000-00-00 00:00:00'),
	(197, 'CakePHP Upgrade 1.3 - 2.0 (Phase 2)', 'Upgrade the CakePHP version to the current standard. &nbsp;', 153134, 8, '4. Would Have', 0, '', 'epic_cakephp_upgrade_3', '', '3. Low', 8, '2017-09-13 10:16:15', '2018-03-08 10:54:24', 0, '0000-00-00 00:00:00'),
