	(200, 'Positive Reporting Rebuild', 'Required for this area to work with the New Hierarchy as well as giving this area a makeover in terms of appearance and improvements.', 229756, 8, '2. Should Have', 0, '', 'epic_positive_reporting_rebuild', '', '3. Low', 8, '2017-09-27 10:30:15', '2018-05-01 11:51:58', 0, '0000-00-00 00:00:00'),
	(201, 'Action Target Date Redesign', '', 229762, 8, '2. Should Have', 0, '', 'epic_action_target_date', '', '3. Low', 1, '2017-09-27 10:32:22', '2018-03-08 10:54:42', 0, '0000-00-00 00:00:00'),
	(202, 'Site Info - Save Progress', 'The ability to save the Site Info wizard without having to fill in the all of the fields. The report cannot be submitted until the whole wizard has been completed.', 225322, 9, '2. Should Have', 0, '', 'epic_site_info_save_progress', '', '2. Medium', 2, '2017-09-27 10:45:14', '2017-10-13 09:53:17', 0, '0000-00-00 00:00:00'),
	(203, 'Repeat Previous Assessment - Part 1 - Controls', 'When carrying out a new assessment, users will be able to pull information from a previous report. Currently this only allows for selection of the exact same assessment type but the new feature will allow for selection of controls to be populated from any type of report which uses the same controls. The standard example is the re-use of controls between single and multi discipline inspections e.g. Fire Risk Assessment and a Triple Combined.&nbsp;', 225322, 9, '2. Should Have', 0, '', 'epic_previous_assessment_controls', '', '1. High', 1, '2017-09-27 10:46:59', '2017-10-13 09:55:45', 0, '0000-00-00 00:00:00'),
	(204, 'Repeat Previous Assessment - Part 2 - Site Info', 'When carrying out a new assessment, users will be able to pull information from a previous report. Currently this only allows for selection of the exact same assessment type but the new feature will allow for selection of site information&nbsp;to be populated from any type of report which uses the report sections. The standard example is the re-use information between single and multi discipline inspections e.g. the Fire Safety section in both a&nbsp;Fire Risk Assessment and a Triple Combined.&nbsp;', 225322, 9, '3. Could Have', 0, '', 'epic_previous_assessment_site_info', '', '3. Low', 9, '2017-09-27 10:51:57', '2017-10-16 14:57:52', 0, '0000-00-00 00:00:00'),
